import React from "react";
import "./Cart.css"

export const Cart = () => {
  return (
    <div>
      <div className="contenedor">
        <div className="cabecera">
            <h1> Hola </h1>
        </div>

        <div className="menu"></div>

        <div className="contenido"></div>

        <div className="pie"></div>
      </div>
    </div>
  );
};
